    /**
     * Gets the attribute value for the calculated attribute TransBOM.
     * @return the TransBOM
     */
    public String getTransBOM() {
        if (getBomId() != null) {
           // ViewObjectImpl itemdescvoimpl = getAM().getLOVBomVO1();
           ViewObjectImpl itemdescvoimpl = getAM().getLOVDisplayBOMVO1();
            itemdescvoimpl.setNamedWhereClauseParam("BindCldId", getCldId());
            itemdescvoimpl.setNamedWhereClauseParam("BindHoOrgId", getHoOrgId());
            itemdescvoimpl.setNamedWhereClauseParam("BindOrgId", getOrgId());
            itemdescvoimpl.setNamedWhereClauseParam("BindSlocId", getSlocId());
            itemdescvoimpl.setNamedWhereClauseParam("BindItemId", getOutptItmId());
            itemdescvoimpl.executeQuery();
            Row[] wcRow = itemdescvoimpl.getFilteredRows("Docid", getBomId());
            if (wcRow.length > 0) {
                if (wcRow[0].getAttribute("Bomdesc") != null) {

                    try {
                        return wcRow[0].getAttribute("Bomdesc").toString();
                    } catch (Exception sqle) {
                        sqle.printStackTrace();
                    }
                }
            }
        }

        return (String) getAttributeInternal(TRANSBOM);
    }

